import axios from 'axios';
import { useState, useEffect } from 'react';

function Connexion() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    async function fetchUsers() {
      const response = await axios.get('/api/users');
      setUsers(response.data);
    }
    fetchUsers();
  }, []);

  return (
    <div>
      {users.map(user => (
        <div key={user._id}>
          <h2>{user.name}</h2>
          <p>{user.email}</p>
        </div>
      ))}
    </div>
  );
}

export default Connexion;
